import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../styles/style.css";
import logo from "../assets/logo_image.png";

const Navbar = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [userRole, setUserRole] = useState("guest");
  const navigate = useNavigate();

  useEffect(() => {
    // Simulate a user login
    // Replace this mock logic with actual authentication logic
    const storedAuthStatus = localStorage.getItem("isAuthenticated") === "true";
    const storedUserRole = localStorage.getItem("userRole") || "guest";

    setIsAuthenticated(storedAuthStatus);
    setUserRole(storedUserRole);
  }, []);

  const handleLogin = () => {
    // Simulate login for demonstration purposes
    setIsAuthenticated(true);
    setUserRole("admin");
    localStorage.setItem("isAuthenticated", "true");
    localStorage.setItem("userRole", "admin");
    navigate("/admin"); // Redirect to Admin Dashboard after login
  };

  const handleLogout = () => {
    // Clear authentication status and user role
    setIsAuthenticated(false);
    setUserRole("guest");
    localStorage.removeItem("isAuthenticated");
    localStorage.removeItem("userRole");
    navigate("/login"); // Redirect to Login page after logout
  };

  return (
    <nav className="navbar">
      <img src={logo} alt="New Age School Logo" className="logo" />
      <ul className="nav-links">
        {/* Main Navigation Links */}
        <li><Link to="/home">Home</Link></li>
        <li><Link to="/group-discussion">Group Discussion</Link></li>
        <li><Link to="/exercise-gathering">Exercise Gathering</Link></li>
        <li><Link to="/principal-office">Principal Office</Link></li>
        <li><Link to="/award-nigeria">Award</Link></li>
        <li><Link to="/excursion-outdoor">Excursion</Link></li>
        <li><Link to="/student-counselor">Counselor</Link></li>

        {/* Role-Based Dashboards */}
        <li><Link to="/student">Student Dashboard</Link></li>
        <li><Link to="/parent">Parent Dashboard</Link></li>
        <li><Link to="/teacher">Teacher Dashboard</Link></li>
        <li><Link to="/counselor">Counselor Dashboard</Link></li>
        <li><Link to="/principal">Principal Dashboard</Link></li>

        {/* Admin Dashboard */}
        {isAuthenticated && userRole === "admin" && (
          <li><Link to="/admin">Admin Dashboard</Link></li>
        )}

        {/* Conditional Login/Logout */}
        {!isAuthenticated ? (
          <li className="login-link">
            <button onClick={handleLogin}>Login</button>
          </li>
        ) : (
          <li className="logout-link">
            <button onClick={handleLogout}>Logout</button>
          </li>
        )}
      </ul>
    </nav>
  );
};

export default Navbar;
